" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 505px\">",
"   <div class=\"ttl\">",
"    Fractionated photothermolysis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 485px; height: 382px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Fractional photothermolysis involves the delivery of narrow columns of infrared light to the target tissue. In skin, this leads to microscopic columns of thermally damaged tissue (microthermal zones).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
