" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electrocardiographic characteristics of the short QT syndrome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 426px; height: 593px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) A 12-lead ECG showing ECG characteristic of SQT1.",
"    <br>",
"     (B) A 12-lead ECG showing ECG characteristic of SQT4 displaying combined ECG phenotype of Brugada and short QT syndromes. Note that ECG shows Brugada type ST elevation in V1 and V2 after administration of ajmaline in addition to short QT intervals.",
"     <div class=\"footnotes\">",
