"      Reproduced with permission from: Patel C, Yan GX, Antzelevitch C. Short QT syndrome: from bench to bedside. Circ Arrhythm Electrophysiol 2010; 3:401. Copyright &copy; 2010 Lippincott Williams &amp; Wilkins.",
